import React from 'react';
import Slider from 'infinite-react-carousel';

export class ImageSlider extends Component {
    render() {
        return (
            <Slider dots>
                <div className="row">
                    {this.props.data
                        ? this.props.data.map((imageObject, index) => (
                            <div key={index}>
                                <img src={imageObject.imgurl} />
                            </div>
                        ))
                        : "loading"}
                </div>
            </Slider>
        );
    }
}
export default ImageSlider;
